import TopMenu from "./components/TopMenu";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import LandingPage from "./components/LandingPage";

function App() {
  return (
    <Router>
      <div className="App">
        <TopMenu />
        <Routes>
          <Route to="/" element={<LandingPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
